var tipuesearch = {"pages": [{'title': 'About', 'text': '倉儲: https://github.com/mdecd2023/2a-pj1ag7 \n 網頁:  https://mdecd2023.github.io/2a-pj1ag7/ \n \n', 'tags': '', 'url': 'About.html'}, {'title': 'W3', 'text': '', 'tags': '', 'url': 'W3.html'}, {'title': '41023106李凱新心得', 'text': '心得:一開始用倉儲時，沒有綁定github，所以沒辦法Acp。然後我們使用FORK，去問老師才知道，我把檔案抓到自己的倉儲，所以沒傳到靜態， 直接以 acp 進行 git add, commit 與 push， 後來我從新用一次就成功了。 \n', 'tags': '', 'url': '41023106李凱新心得.html'}, {'title': '進度', 'text': '2023/3/8 \n bubbleRob目前用到感測器 \n 2023/3/9 \n bubbleRob目前用到輪子和jiont', 'tags': '', 'url': '進度.html'}, {'title': 'HW', 'text': '\n  導入 brython 程式庫  \n \n \n  啟動 Brython  \n \n  導入 FileSaver 與 filereader  \n \n \n \n \n  導入 ace  \n \n \n \n \n \n \n  請注意, 這裡使用 Javascript 將 localStorage["py_src"] 中存在近端瀏覽器的程式碼, 由使用者決定存檔名稱 \n \n \n \n  印出版次與關鍵字程式  \n \n \n \n  用來顯示程式碼的 editor 區域  \n \n  以下的表單與按鈕與前面的 Javascript doSave 函式以及 FileSaver.min.js 互相配合  \n  存擋表單開始  Filename:  .py    存擋表單結束  \n \n  執行與清除按鈕開始  \n Run   Output   清除輸出區 清除繪圖區 Reload \n  執行與清除按鈕結束  \n \n  程式執行 ouput 區  \n \n  Brython 程式執行的結果, 都以 brython_div 作為切入位置  \n \n', 'tags': '', 'url': 'HW.html'}, {'title': 'HW1', 'text': '\n 到感測器 \n', 'tags': '', 'url': 'HW1.html'}]};